import React, { useContext } from "react";
import "./Blogitem.css"
export default function Blogitem(props) {
    const { user } = props;

    return (
        <>
            <div className={`col-md-3 `}>
                <div class="card my-3">
                    <div class={`card-body bg-${props.mode}`}>
                        <h5 class={`card-title text-${props.mode === "light" ? "rgb(0,0,0)" : "white"}`}>{user.name}</h5>
                        <p class={`card-text text-${props.mode === "light" ? "rgb(0,0,0)" : "white"}`}>{user.email}</p>
                    </div>
                </div>
            </div>
        </>
    )
}
